def word_count(start_words, target_words)
    result = 0
    target_words.each do |word|
    	if word.length == 1 then next end
    	selected_words = start_words.filter{|a| a.length == word.length-1}
    	if selected_words.length == 0 then next end
    	selected_words.each do |temp|	
    		if (word.split('')-temp.split('')).length == 1 then result=result+1; break end
    	end
    end
    result
end


